import React from 'react';
import {SafeAreaView, Text, Image} from 'react-native';
import CurrencyConverter from './CurrencyConverter';

const App = () => {
  return (
    <SafeAreaView>
      <Image source={require("./assets/dollar_golden.png")}></Image>
      <Text>MADS Lab Test 2 Exhchange Calculator</Text>
      <CurrencyConverter/>
    </SafeAreaView>
  );
}

export default App;
